import React, { Component } from "react";



class Inscription extends Component {
render() {
    return (
        
          
          
            <form className="k-form">
              <fieldset>
                <legend>Sign up</legend>
                <div>
                  
                    name="firstName"
                    label="First name"
                  
                </div>
                <div>
                  
                    name="lastName"
                    label="Last name"
                  
                </div>
              </fieldset>
              <button
                type="submit"
                className="k-button"
              >
                Submit
              </button>
            </form>
          
        
      );
    };
}

export default Inscription;
